import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import StudentQA from './StudentQA'; // Import your components
import StudentInstructor from './StudentInstructor'; // Import your components
import StudentAdmin from './StudentAdmin'; // Import your components
import StudentPro from './StudentPro'; // Import your components
import InstructorQA from './InstructorQA'; // Import your components
import ProgramCoordinatorDashboard from './ProgramCoordinatorDashboard'; // Import your components
import QADashboard from './QADashboard'; // Import your components

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/student-qa" component={StudentQA} />
          <Route exact path="/Messages-qa" component={StudentInstructor} />
          <Route exact path="/instructor-qa" component={InstructorQA} />
          <Route exact path="/procord-qa" component={ProgramCoordinatorDashboard} />
          <Route exact path="/student-admin" component={StudentAdmin} />
          <Route exact path="/qaofficer-admin" component={QADashboard} />
          <Route exact path="/student-pro" component={StudentPro} />
          {/* Add more routes for other pages as needed */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
